import React from 'react';
import Grid from '@material-ui/core/Grid';
import styles from '../../css/Home.module.css';

export const Showcase = () => {
    return(
        <React.Fragment>
            <Grid container>
                <Grid item xs={5}>
                    <div className={styles.showcaseBox1}>111</div>
                </Grid>
                <Grid item xs={7} style={{paddingLeft:"2%"}}>
                    <div className={styles.showcaseBox2}>222</div>
                </Grid>     
            </Grid>
        </React.Fragment>
    )
}
